import javax.swing.*;
import java.util.Base64;

public class GoodbyeFrame extends JFrame {

    public GoodbyeFrame() {
        // Configurações para o JFrame
        setTitle(":\\");
        setSize(300, 230);
        setResizable(false);
        setDefaultCloseOperation(JFrame.EXIT_ON_CLOSE);

        // Define a imagem em base64
        String base64Image = "data:image/jpeg;base64,";

        // Decodifica a imagem base64
        byte[] imageBytes = Base64.getDecoder().decode(base64Image.split(",")[1]);

        // Cria um ImageIcon a partir dos bytes da imagem
        ImageIcon imageIcon = new ImageIcon(imageBytes);

        // Cria um JLabel para exibir a imagem
        JLabel label = new JLabel(imageIcon);

        // Adiciona o JLabel ao JFrame
        add(label);

        // Centraliza o JFrame na tela
        setLocationRelativeTo(null);
    }

    public static void main(String[] args) {
        // Cria e exibe o JFrame
        SwingUtilities.invokeLater(() -> {
            GoodbyeFrame frame = new GoodbyeFrame();
            frame.setVisible(true);
        });
    }
}
